    <button
      type="submit"
      onClick={handleSearch}
      className="w-28 bg-white-500 border border-black rounded-md py-2 px-4 flex items-center justify-center text-base font-medium text-black hover:bg-gray-100"
    >
      {value}
    </button> 
    </div>
  )
}

export default Button
